import React, { Component } from 'react';
import RoomsContainer from '../Coponent/RoomContainer';
import Navibar from '../Coponent/Navibar';
import RoomSearch from '../Coponent/RoomSearch';




export default class Room extends Component {
    constructor(props){
        super(props);
        this.state = {
            se:[]
        }

    }

    render() {   
        return (
            <div className="room">
                <Navibar />
                <RoomSearch city={this.props.s.city} suburb={this.props.s.suburb} checkin={this.props.s.check_in_date} checkout={this.props.s.check_out_date}/>
            </div>    
        );
    }
}
